objetoCompra:
Contratação de empresa especializada para execução de serviço de reforma completa do telhado dos vestiários e gabinetes de vereadores localizados no prédio Anexo 2 da Câmara Municipal de Valença/RJ, com fornecimento de materiais e mão de obra, abrangendo:
•	Substituição das telhas danificadas por novas peças de mesma especificação ou superior;
•	Refazimento integral das cumeeiras do telhado, garantindo vedação adequada e durabilidade;
•	Reconstrução do cordão do telhado, com aplicação de argamassa e acabamento conforme normas técnicas;
•	Substituição de madeiramento deteriorado ou comprometido, com reforço da estrutura, se necessário;
•	Instalação de manta térmica e impermeável sob o telhado, visando a melhoria do conforto térmico e prevenção de infiltrações;
•	Garantia mínima de 12 (doze) meses sobre os serviços executados;
•	Prazo máximo de execução: 60 (sessenta) dias corridos, contados a partir da emissão da ordem de serviço;
•	Inclusão integral de todos os materiais, equipamentos, insumos e mão de obra necessários à execução dos serviços, conforme proposta aprovada e Termo de Referência.

AQUISIÇÃO DE INSUMOS LABORATORIAIS, PARA REALIZAÇÃO DE ANÁLISE DE ÁGUAS ENVASADAS (ÁGUA MINERAL) PARA CONSUMO HUMANO ATENDENDO O SETOR DE PRODUTOS E MEIO AMBIENTE DO LACEN RO POR UM PERÍODO DE 12 MESES. 

Esterilidade: Os frascos devem ser estéreis conforme ISO 11137-02, estando ainda com lacre que garanta que os materiais não forma violados. Esse critério garante a confiabilidade dos ensaios.

Presença de tiossulfato de sódio pulverizado com capacidade para remoção de cloro até 15mg/l: É recomendação do Standard Methods, seção 9060A.2. Essa substância garante a neutralização da reação do cloro na amostra, evitando que seja eliminado os micro-organismos que se busca investigar;
